import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Wait for the "Sort by" select using its label text as anchor
    await page.waitForSelector('label[for="sortSelect"]', { timeout: 5000 });

    // Use a different selector: select by name attribute (if present), else fallback to id
    // Here, use XPath to find the select next to the label with text "Sort by:"
    const sortSelect = await page.waitForSelector(
      '//label[contains(text(), "Sort by")]/following-sibling::select[1] | //select[@id="sortSelect"]',
      { timeout: 5000 }
    );

    // Take screenshot before changing sort
    const step2 = path.join(screenshotsDir, 'step_2_sort_dropdown_visible.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Open the select and choose "Price: Low to High" by its visible text
    // Get all options and find the one with the correct text
    const options = await sortSelect.$$('option');
    let priceLowValue = null;
    for (const option of options) {
      const text = await option.textContent();
      if (text && text.trim().toLowerCase().includes('price: low')) {
        priceLowValue = await option.getAttribute('value');
        break;
      }
    }
    if (!priceLowValue) throw new Error('Could not find "Price: Low to High" option');

    await sortSelect.selectOption(priceLowValue);

    // Wait for the sort to apply (look for notification or product order change)
    // Wait for a notification with text "Sorted by Price: Low to High" (using text selector)
    await page.waitForSelector('text=Sorted by Price: Low to High', { timeout: 5000 });

    // Take screenshot after sort applied
    const step3 = path.join(screenshotsDir, 'step_3_price_sort_applied.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // Extract the titles and prices of the first 3 products shown
    // Use the product card class and extract inner text
    const productCards = await page.$$('.product-card, .product-card-list');
    const extractedData = { products: [] };
    for (let i = 0; i < Math.min(3, productCards.length); i++) {
      const card = productCards[i];
      // Try to get title and price using different selectors
      const title = await card.$eval('.product-title', el => el.textContent.trim()).catch(() => null);
      const price = await card.$eval('.product-price', el => el.textContent.replace(/[^0-9\.\$]/g, '').trim()).catch(() => null);
      extractedData.products.push({ title, price });
    }

    return {
      success: true,
      action: 'Applied "Price: Low to High" sort filter and extracted top 3 product titles/prices',
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
